import * as React from 'react';
import { View, Text} from 'react-native';
import { Button, TextInput } from 'react-native-web';
import Feather from 'react-native-vector-icons/Feather'; 


function BreakfastScreen({navigation}) {
    return (
      <View style={{ flexDirection:'row', borderColor:'#C6C6C6', borderWidth:1,borderRadius:8,paddingHorizontal:10,paddingVertical:8, }}>
        <Feather 
        name="Search" 
        size={20} 
        color={"#C6C6C6"} 
        style={{marginRight:5}
        }/>
        <TextInput placeholder="Search"/>
        <Text>Category</Text>
        <Button style={{flex: 1, alignItems:'center', justifyContent:'center'}}
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
      </View>
    );
}
export default BreakfastScreen;
